defs.value:
pub enum ImplItem {
    FnDef(FnDef),
    TypeAliasDef(TypeAliasDef),
    ConstDef(ConstDef),
}

pub enum PathSegmentKind {
    Name(ast::NameRef),
    Type {
        type_ref: Option<ast::TypeRef>,
        trait_ref: Option<ast::PathType>,
    },
    SelfKw,
    SuperKw,
    CrateKw,
}

pub enum StructKind {
    Tuple(ast::TupleFieldDefList),
    Named(ast::RecordFieldDefList),
    Unit,
}

pub enum SelfParamKind {

    /// self
    Owned,

    /// &self
    Ref,

    /// &mut self
    MutRef,
}

pub enum TypeBoundKind {

    /// Trait
    PathType(ast::PathType),

    /// for<'a> ...
    ForType(ast::ForType),

    /// 'a
    Lifetime(ast::SyntaxToken),
}

pub enum PrefixOp {

    /// The `*` operator for dereferencing
    Deref,

    /// The `!` operator for logical inversion
    Not,

    /// The `-` operator for negation
    Neg,
}

pub enum BinOp {

    /// The `||` operator for boolean OR
    BooleanOr,

    /// The `&&` operator for boolean AND
    BooleanAnd,

    /// The `==` operator for equality testing
    EqualityTest,

    /// The `!=` operator for equality testing
    NegatedEqualityTest,

    /// The `<=` operator for lesser-equal testing
    LesserEqualTest,

    /// The `>=` operator for greater-equal testing
    GreaterEqualTest,

    /// The `<` operator for comparison
    LesserTest,

    /// The `>` operator for comparison
    GreaterTest,

    /// The `+` operator for addition
    Addition,

    /// The `*` operator for multiplication
    Multiplication,

    /// The `-` operator for subtraction
    Subtraction,

    /// The `/` operator for division
    Division,

    /// The `%` operator for remainder after division
    Remainder,

    /// The `<<` operator for left shift
    LeftShift,

    /// The `>>` operator for right shift
    RightShift,

    /// The `^` operator for bitwise XOR
    BitwiseXor,

    /// The `|` operator for bitwise OR
    BitwiseOr,

    /// The `&` operator for bitwise AND
    BitwiseAnd,

    /// The `=` operator for assignment
    Assignment,

    /// The `+=` operator for assignment after addition
    AddAssign,

    /// The `/=` operator for assignment after division
    DivAssign,

    /// The `*=` operator for assignment after multiplication
    MulAssign,

    /// The `%=` operator for assignment after remainders
    RemAssign,

    /// The `>>=` operator for assignment after shifting right
    ShrAssign,

    /// The `<<=` operator for assignment after shifting left
    ShlAssign,

    /// The `-=` operator for assignment after subtraction
    SubAssign,

    /// The `|=` operator for assignment after bitwise OR
    BitOrAssign,

    /// The `&=` operator for assignment after bitwise AND
    BitAndAssign,

    /// The `^=` operator for assignment after bitwise XOR
    BitXorAssign,
}

pub enum ArrayExprKind {
    Repeat {
        initializer: Option<ast::Expr>,
        repeat: Option<ast::Expr>,
    },
    ElementList(AstChildren<ast::Expr>),
}

pub enum LiteralKind {
    String,
    ByteString,
    Char,
    Byte,
    IntNumber {
        suffix: Option<SmolStr>,
    },
    FloatNumber {
        suffix: Option<SmolStr>,
    },
    Bool,
}
